import React from "react";
import { useNavigate } from "react-router-dom";

const categories = [
  { name: "Ayam", imageUrl: "data:image/jpeg;base64," },
  { name: "Pagi", imageUrl: "data:image/jpeg;base64," },
  { name: "Malam", imageUrl: "data:image/jpeg;base64," },
  { name: "Sarapan", imageUrl: "data:image/jpeg;base64," },
  { name: "Tradisional", imageUrl: "data:image/jpeg;base64," },
  { name: "Daging", imageUrl: "data:image/jpeg;base64," },
  { name: "Sayuran", imageUrl: "data:image/jpeg;base64," },
  { name: "Seafood", imageUrl: "data:image/jpeg;base64," },
  { name: "Coding", imageUrl: "data:image/jpeg;base64," }
];

const Kategori = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (category) => {
    navigate(`/resep?kategori=${category}`);
  };

  return (
    <div className="category-container">
      {categories.map((category) => (
        <div key={category.name} className="category-card" onClick={() => handleCategoryClick(category.name)}>
          <img src={category.imageUrl} alt={category.name} />
          <h3>{category.name}</h3>
        </div>
      ))}
    </div>
  );
};

export default Kategori;
